window.bookSummaryJSON = "<p>The<i> New York Times</i> and <i>USA Today</i> best-selling series&nbsp;&nbsp;</p> <p><b>They will dive, but will humanity survive?</b></p> <p>Left for dead on the nightmarish surface of the planet, Commander Michael Everhart and his team of Hell Divers barely escape with their lives aboard a new airship called Deliverance. After learning that Xavier “X” Rodriguez may still be alive, they mount a rescue mission for the long-lost hero.</p> <p>In the skies, the Hive is falling apart, but Captain Jordan is more determined than ever to keep humanity in their outdated lifeboat. He will do whatever it takes to keep the ship in the air - even murder. But when he learns the Hell Divers he exiled have found Deliverance, he changes course for a new mission - find the divers, kill them, and make their new ship his own.&nbsp;</p> <p>In the third installment of the Hell Divers series, Michael and his fellow divers fight across the mutated landscape in search of X. But what they find will change everything.&nbsp;</p>"; 
